import React from 'react';
import { motion } from 'framer-motion';

export default function AnimeImages() {
    return (
        <>
            <motion.div
                style={{
                    display: 'flex',
                    justifyContent: 'space-around',
                    alignItems: 'center',
                    height: '100vh',
                    backgroundColor: '#000000',
                }}
            >
                {/* Premier conteneur */}
                <motion.div
                    initial={{ y: 200 }}
                    animate={{ y: 0 }}
                    transition={{
                        duration: 1.5,
                        ease: 'easeInOut',
                    }}
                    style={{
                        width: '200px',
                        height: '300px',
                        backgroundColor: '#ffffff',
                        borderRadius: '15px',
                        overflow: 'hidden',
                        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                    }}
                >
                    <motion.img
                    drag
                        src="https://images6.alphacoders.com/135/1352218.png" // Image de Luffy
                        alt="Luffy"
                        style={{
                            width: '100%',
                            height: '100%',
                            objectFit: 'cover',
                        }}
                        whileTap={{ y: -20 }}
                        animate={{
                            rotate: 360,
                            x: ["-70vw", "0vw", "-70vw", "0vw", "-70vw", "0vw"],
                        }}
                        transition={{
                            duration: 1,
                            delay: 1,
                            //repeat: Infinity,
                        }}
                    />
                </motion.div>

                {/* Deuxi√®me conteneur */}
                <motion.div
                    initial={{ y: 200 }}
                    animate={{ y: 0 }}
                    transition={{
                        duration: 1.5,
                        ease: 'easeInOut',
                        delay: 0.3,
                    }}
                    style={{
                        width: '200px',
                        height: '300px',
                        backgroundColor: '#ffffff',
                        borderRadius: '15px',
                        overflow: 'hidden',
                        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                    }}
                >
                    <motion.img
                        src="https://images2.alphacoders.com/136/1369365.jpeg" // Image de Zoro
                        alt="Zoro"
                        style={{
                            width: '100%',
                            height: '100%',
                            objectFit: 'cover',
                        }}
                        whileTap={{ y: -20 }}
                        animate={{
                            rotate: 360,
                            x: ["-70vw", "0vw", "-70vw", "0vw", "-70vw", "0vw"],
                        }}
                        transition={{
                            duration: 1,
                            delay: 1,
                            repeat: Infinity,
                        }}
                    />
                </motion.div>
            </motion.div>
            <motion.footer
                id="contact"
                style={{
                    height: '60px',
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    backgroundColor: '#222',
                    color: '#fff',
                    fontSize: '16px',
                    boxShadow: '0 -4px 10px rgba(0, 0, 0, 0.2)',
                }}
                initial={{ y: 100 }}
                animate={{ y: 0 }}
                transition={{ duration: 1, ease: 'easeOut' }}
            >
                <ul>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#home">Home</a></motion.li>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#about">About</a></motion.li>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#services">Services</a></motion.li>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#contact">Contact</a></motion.li>
                </ul>
                <ul>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#privacy">Privacy Policy</a></motion.li>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#terms">Terms of Service</a></motion.li>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#faq">FAQ</a></motion.li>
                    <motion.li 
                        whileHover={{
                            x: 10,
                            color: 'darkgoldenrod'
                        }}
                    ><a href="#support">Support</a></motion.li>
                </ul>
            </motion.footer>
        </>
    );
}
